interface InputComponentProps {
  label: string;
}

const InputComponent: React.FC<InputComponentProps> = ({ label }) => {
  return (
    <div className='row col-8'> 
      <input id="inputField" type="text" placeholder={label}/>
    </div>
  );
};

export default InputComponent;
